(57989, 129787, 0, 1, '回憶-Demo(鋼琴)', '聽著別人的故事 感傷的寫著歌', '2012-12-24 00:00:00', 2000, 0, 2, 4, '回憶\r\n\r\n詞曲編唱/亞崴尤奈\r\n\r\n憂鬱的我 看著心上的枷鎖\r\n唱著我最愛 的歌\r\n凌晨時刻 吸著失眠的空氣\r\n心裡想著扛林勞木\r\n\r\n如果是夢 我想沉醉在這裡\r\n不想醒來 的夢\r\n\r\n清晰的感覺 彷彿像是在身邊\r\n永遠不會變 的回憶\r\n妳曾答應我 陪我追尋的夢想\r\n現在卻成為 妳離開 的理由\r\n\r\n曾捧在手中的甜心\r\n現在卻變成陌生人\r\n曾累積的甜蜜故事 \r\n卻剩一幕幕的回憶\r\n', '', 186, '', 'Yawi', 'Yawi', 'Yawi', '', '', 0, 0, 0, '2012-12-24 22:05:10', '2015-03-12 13:57:57', '0000-00-00 00:00:00'),
(57990, 166939, 0, 1, '哲學家', ' “風和日麗的下午，日麗又風和。。。”\n簡單的旋律像在悶熱的空調間呆了很久以後，\n推門迎面遇見定新鮮空氣，\n瞬間被吸進身體裡面，\n然後打一個冷顫，\n變得精神抖擻。\n\n這一首在公車上被創作出的歌，\n有着甜蜜愛戀氣息，活力清新不造作。\n\n“因為迷戀你，\n說話也成真理，\n就是我的哲學家。”', '2012-12-24 00:00:00', 2012, 19, 0, 4, '', '', 198, '', '蛤小蟆', '蛤小蟆', '', '想玩音樂唱片', '', 1, 1, 0, '2012-12-24 22:42:45', '2015-03-12 13:57:57', '0000-00-00 00:00:00'),
(57991, 165273, 0, 1, '我是誰', '', '2012-12-24 00:00:00', 2000, 0, 1, 7, '叫醒我\r\n讓我不要在這樣胡鬧的世界\r\n隨波逐流\r\n浮浮沉沉\r\n在我沒把握不會溺斃的時候\r\n別讓我墜落\r\n\r\n張開雙手不夠\r\n鬆綁了我的手\r\n走到十字路口\r\n別叫我再回頭\r\n\r\nHEY 我是誰\r\n不要把我留在這畫面\r\n找不到出口那天\r\n原來猙獰的是我的臉', '', 223, '', '大頭', '大頭', '重擊者', '重擊者', '', 1, 1, 1, '2012-12-24 23:37:45', '2014-04-26 21:11:01', '2014-04-26 21:11:01'),
(57992, 166989, 0, 1, '隨風過去', '', '2012-12-26 00:00:00', 2000, 0, 1, 4, '', '', 307, '', '', '', '', '', '', 0, 1, 0, '2012-12-24 23:58:52', '2015-03-12 13:57:57', '0000-00-00 00:00:00'),
(57993, 115508, 0, 1, 'I Wish', '如果現在的一切都是一場夢,醒來時會有多好？\r\n也許有些失去的，比未日來得更早。 也許像夢的，就是你和我。', '2012-12-25 00:00:00', 2012, 0, 1, 7, 'I wish it was a dream\r\nSo I could have you back to me\r\nI can''t stop it now\r\nAs you''ve gone a step too far from me\r\n\r\nI am still here\r\nwhy am I still here\r\n\r\nThey took away my loved one\r\nThey took away my soul\r\nBut why didn''t they take away \r\nmy life when they go\r\n\r\nI''m here\r\nAlone in here\r\nI am here\r\nAlone in here\r\n\r\nI have so much to say to you\r\nHow I wish it wasn''t you\r\nNow I know the world is cruel\r\nHow I wish it wasn''t true\r\n\r\nCould this be true\r\nHow could this be true\r\n\r\nThey took away my loved one\r\nThey took away my soul\r\nBut why didn''t they take away \r\nmy life when they go\r\n\r\nI''m here\r\nAlone in here\r\nI am here\r\nAlone in here\r\n\r\nI see your face in everything\r\nI see your face on everyday \r\nI''m here\r\nAlone in here\r\nI am here\r\nAlone in here', '', 233, '', 'Eric Chan', 'Eric Chan', 'Eric Chan', '黑市音樂', '', 1, 1, 0, '2012-12-25 01:10:10', '2015-03-12 13:57:57', '0000-00-00 00:00:00'),
(57994, 4415, 4887, 1, 'Second Story 第二個故事', 'Piano by 易士傑\r\n\r\n世界上的第二個故事--摩西的冒險、以色列人的冒險，同時也可以是你是我是台灣人是全人類的冒險。要脫離被極權壓制、被執政者欺壓剝削的困境，所需要的勇氣，也許光從一個人的心裡尋找還不夠。我相信，集體的意志跟渴望，會引起擁有更偉大力量的存在--神的垂聽和憐憫，給我們決心和能力，帶領我們脫離殘酷的現狀。', '2012-08-18 00:00:00', 2000, 0, 1, 3, '', '', 109, '', 'Sam Lee', '', 'Sam Lee', '', '', 1, 1, 0, '2012-12-25 01:13:16', '2015-03-12 13:57:57', '0000-00-00 00:00:00'),
(57995, 4415, 4887, 2, 'Help Us 幫助我們', '終日不停的勞苦，反覆無止息的夢魘。幾近變態的社會、扭曲的價值觀。反覆的鼓聲象徵永無天日的勞苦，side chain compression的合成synth bass是一把利劍，渴望能切開雲霧，看見希望看見青天！且聽一曲"Help Us"，聽聽底層人民心底的吶喊！', '2012-08-18 00:00:00', 2000, 0, 1, 3, '', '', 217, '', 'Sam Lee', '', 'Sam Lee', '', '', 0, 1, 0, '2012-12-25 01:14:55', '2015-03-12 13:57:57', '0000-00-00 00:00:00'),
(57996, 4415, 4887, 3, 'Miracle 奇蹟', '不停反覆的勞苦工作，心理永遠找尋不到真正的平安。我們面對的世界，是否正逐步機械化？我們的靈魂是否逐漸枯萎？\r\n\r\n物質的充裕已經不再能滿足我們的心。我們要的更多、更多，卻怎麼也無法填滿自己。你我眼界有限，人的能力有限。我們需要依靠更大的力量，來得到精神上的滿足。神所行的事、在人眼中看為不可能的事，就是奇蹟。人的心，需要奇蹟的救贖，才能進入永恆的樂土。當我們懷著希望，大步的向前邁進，縱然一路上跌跌撞撞，但只要懷著堅定的信心，奇蹟終將降臨。', '2012-08-18 00:00:00', 2000, 0, 1, 3, '', '', 240, '', 'Sam Lee', '', 'Sam Lee', '', '', 0, 1, 0, '2012-12-25 01:16:49', '2015-03-12 13:57:57', '0000-00-00 00:00:00'),
(57997, 4415, 4887, 4, 'Star of Hope 希望之星', '希望之星，指引了方向。希望之星是甚麼？是誰？指引的方向通往何處？\r\n\r\n即使你還沒發現，但是你的人生一直有這麼一顆希望之星，堅定的懸掛在空中，祂能帶領你前進，穿過死蔭的山谷。祂的光芒，照亮人生的黑夜路，也溫暖你疲憊的心。', '2012-08-18 00:00:00', 2000, 0, 1, 3, '', '', 285, '', '', '', '', '', '', 0, 1, 0, '2012-12-25 01:18:57', '2015-03-12 13:57:57', '0000-00-00 00:00:00'),
(57998, 4415, 4887, 5, 'Horeb 何烈山', '何烈山，幾千年來堅定的矗立著，見證著歷史，也見證了神跟人建立關係的過程。\r\n\r\n人的心何等軟弱，背叛、逃離等等念頭充斥我們的心中。生活的苦、生命的難處，何烈山知道、神也知道。是否，不經歷這段乾涸的過程，就無法獲得新生？\r\n\r\n每個人心中都有一座何烈山，也許爬這座山，異常的艱難困酷，但是人生中不可或缺、意義非凡的旅程。', '2012-08-18 00:00:00', 2000, 0, 1, 3, '', '', 215, '', '', '', '', '', '', 0, 1, 0, '2012-12-25 01:20:40', '2015-03-12 13:57:57', '0000-00-00 00:00:00'),
(57999, 4415, 4887, 6, 'Seeking the Right Way 追尋正道', '黑道白道，誰才是正道？當人民的生活陷入困境、當是非黑白對錯的界限逐漸模糊，你不禁要問，世界的公平正義在何方？神在哪裡？\r\n\r\n夢魘就像Drum and Bass，迅速且具滲透力，轉眼間就佈滿你的生命。請記得，用力的傾聽心裡微小的聲音，努力在心中尋找神、尋找正義。', '2012-08-18 00:00:00', 2000, 0, 1, 3, '', '', 234, '', '', '', '', '', '', 0, 1, 0, '2012-12-25 01:22:31', '2015-03-12 13:57:57', '0000-00-00 00:00:00'),
(58000, 4415, 4887, 7, 'Your Guidance 祢的帶領', '我們都曾遇見看似光明、看似合乎常理，卻是冠冕堂皇的謊言。這些人這些事，揭開偽善的面紗，背後卻可能有著醜陋的本質。\n\n人的理解力是何等的虛弱，求神憐憫，張開我們的雙眼，讓我們能明辨誰才是人生路上的明燈，也明辨誰是披著羊皮的腐狼。天公！請帶領我們披荊斬棘，斬斷這些虛空謊言。', '2012-08-18 00:00:00', 2000, 0, 1, 3, '', '', 234, '', '', '', '', '', '', 0, 1, 0, '2012-12-25 01:24:57', '2015-03-12 13:57:57', '0000-00-00 00:00:00'),
