(58115, 103807, 5456, 1, '小說家', '', '2012-12-25 00:00:00', 2012, 0, 2, 7, '小說家\r\n\r\n嗨！親愛的人們\r\n我時常認真聽你們的心啊\r\n全心全意我只為感覺這一切\r\n\r\n而我用盡我心意\r\n任巨大的時間之流通過\r\n任俗氣的歌曲它播送\r\n任你所愛的人兒離開\r\n任巨大的時間之流通過\r\n任俗氣的歌曲它播送\r\n任你所愛的人兒離開\r\n任他們啊回到應該待的地方\r\n\r\n啊！有許多話在那我的耳邊啊飄盪\r\n就算你甚麼話都沒有說\r\n全心全意我盡我心意 全心全意我盡我心意', '', 189, '', '老貓偵探社', '老貓偵探社', 'White Pony Music Studio(阿哲)', '', '', 1, 1, 0, '2012-12-25 17:27:05', '2015-03-12 13:58:02', '0000-00-00 00:00:00'),
(58116, 167052, 5435, 9, 'The Sky Opened Up', '', '2012-09-12 00:00:00', 2000, 20, 0, 6, '', '', 247, '', '', '', '', '', '', 0, 0, 0, '2012-12-25 17:27:11', '2015-03-12 13:58:02', '0000-00-00 00:00:00'),
(58117, 103807, 5456, 2, '打油詩', '', '2012-12-25 00:00:00', 2012, 0, 2, 7, '打油詩\r\n\r\n才一瞬間啊一眨眼日曆翻了又一頁\r\n屌兒啷噹晃啊晃的我該去哪邊\r\n一天過了又一個月 秋冬春夏唉唷又一年\r\n怎麼會?怎麼會?怎麼會?!!!\r\n\r\n說一句實話來測量日子之間的距離\r\n不用假裝的字我盡量說的真實\r\n照你的樣子來造句 甚麼天氣就押甚麼韻\r\n重複幾次都隨你高興\r\n\r\n喔～唉唷！那打油詩來一首不夠濃的寂寞\r\n從哪兒說 從哪兒說你搖搖頭\r\n有沒有 甚麼滑過心頭從過去的巷弄\r\n隱隱約約 偷偷摸摸輕輕鬆鬆\r\n\r\n又回到麻木的迴圈這韻腳圓了又圓\r\n那些人你討厭那些字讓你厭倦\r\n不說不懂說了沒用 不如去死還幸福一點\r\n對不對?對不對?對不對?!!!\r\n\r\n說甚麼謊才能測量人們之間的距離\r\n說甚麼才能又遠又近又生又親\r\n給愛人要留幾個字 那麼兩行留給那來日\r\n要怎麼說都隨你高興\r\n\r\n唉唷 那唱一首\r\n不夠 還不夠濃\r\n重頭 那再重頭\r\n溜啊溜得又溜上心頭\r\n隱隱約約啊偷偷摸摸\r\n偷偷摸摸啊輕輕鬆鬆\r\n\r\n最後這麻木的迴圈讓韻腳圓了又圓\r\n那些人你討厭那些字讓你厭倦\r\n不說不懂說了沒用 不如去死還幸福一點\r\n對不對?對不對?對不對啊?\r\n', '', 223, '', '老貓偵探社', '老貓偵探社', 'White Pony Music Studio(阿哲)', '', '', 1, 1, 0, '2012-12-25 17:27:32', '2015-03-12 13:58:02', '0000-00-00 00:00:00'),
(58118, 103807, 5456, 3, '老貓偵探', '', '2012-12-25 00:00:00', 2012, 0, 2, 7, '老貓偵探\r\n\r\n謹慎的穿梭在巷子裡的角落\r\n蒐集人類和魚所留下的線索\r\n時間不知不覺已經過了好久\r\n有趣的風景卻怎麼都看不夠\r\n\r\n踏著爵士樂輕快的節奏\r\n就無聲無息的溜走\r\n溜進你生活微小的隙縫\r\n偷走你手心的線索\r\n\r\n本能的掩飾和拒絕都沒有用\r\n你想要甚麼請確實的說出口\r\n連傻瓜偵探都能拆穿的謊話\r\n你確定還有說出口的價值嗎', '', 177, '', '老貓偵探社', '老貓偵探社', 'White Pony Music Studio(阿哲)', '', '', 1, 1, 0, '2012-12-25 17:28:00', '2015-03-12 13:58:02', '0000-00-00 00:00:00'),
