(58120, 103807, 5456, 4, '準備出門', '', '2012-12-25 00:00:00', 2012, 0, 2, 7, '準備出門\r\n\r\n準備出門洗過臉了 我的眼睛還是紅色的\r\n穿上外套拉上那拉鍊 藏起那透明銳利的膚色\r\n脫了線的微笑臉皮 右邊下巴那還差一針\r\n都藏好了泛黃的我 都準備好了我出門了\r\n\r\n你看街上的人們\r\n滿懷心事的向前走著\r\n揹著慾望的道路一步一步\r\n這是不是他要的樣子', '', 191, '', '老貓偵探社', '老貓偵探社', 'White Pony Music Studio(阿哲)', '', '', 1, 1, 0, '2012-12-25 17:28:38', '2015-03-12 13:58:02', '0000-00-00 00:00:00'),
