(58140, 52995, 0, 1, '忘了', '忘了', '2012-12-25 00:00:00', 0000, 0, 1, 1, '我忘  忘了  妳留下的香水味  我忘  忘的  記憶  覆寫\r\n我忘  忘了  妳流過了多少淚  我忘了  劇情  改寫\r\n\r\n時間一樣在呼吸  心裡的淚不再滴  或許這是我們一樣的曾經\r\n輪廓也不再清晰  淒美的過往街景  也許那是屬於我們的陷阱\r\n\r\n眼底心裡  還是騙不了自己  真的沒有勇氣  還是會想起\r\n\r\n我忘  忘了  妳留下的香水味  我忘  忘的  記憶  覆寫\r\n我忘  忘了  妳留過了多少淚  我忘了  劇情  改寫\r\n\r\nsolo\r\n\r\n我忘  忘了  妳留下的香水味  我忘  忘的  記憶  覆寫\r\n我忘  忘了  妳留過了多少淚  我忘了  劇情  改寫\r\n', '', 190, '', '阿廷', '阿廷', '阿廷', '', '', 0, 0, 1, '2012-12-25 20:40:35', '2013-10-07 17:23:25', '0000-00-00 00:00:00'),
(58141, 72723, 0, 0, '1月26號練-唱原key－ Shiver', '', '2012-12-24 00:00:00', 2000, 0, 1, 7, '＜SHIVER＞   - COLDPLAY\r\nSo I look in your direction,\r\nBut you pay me no attention, do you?\r\nI know you don''t listen to me.\r\n''cause you say you see straight through me, don''t you?\r\n\r\nAnd on and on from the moment I wake,\r\nTo the moment I sleep,\r\nI''ll be there by your side,\r\nJust you try and stop me,\r\nI''ll be waiting in line,\r\nJust to see if you care.\r\n\r\nDid you want me to change?\r\nWell I changed for good\r\nAnd I want you to know.\r\nThat you''ll always get your way\r\nI wanted to say,\r\n\r\nDon''t you Shiver?\r\nShiver\r\nSing it loud and clear\r\n\r\nI''ll always be waiting for you,\r\nSo you know how much I need you,\r\nBut you never even see me, do you?\r\nAnd is this my final chance of getting you?\r\n\r\nAnd on and on from the moment I wake,\r\nTo the moment I sleep,\r\nI''ll be there by your side,\r\nJust you try and stop me,\r\nI''ll be waiting in line,\r\nJust to see if you care.\r\n\r\nOh, oh, oh, oh.\r\n\r\nDid you want me to change?\r\nWell I changed for good\r\nAnd I want you to know.\r\nThat you''ll always get your way\r\nI wanted to say,\r\n\r\nDon''t you Shiver?\r\nDon''t you Shiver?\r\n\r\nSing it loud and clear.\r\nI''ll always be waiting for you.\r\n\r\nYeah I''ll always be waiting for you.\r\nYeah I''ll always be waiting for you.\r\nYeah I''ll always be waiting for you.\r\nFor you,\r\nI will always be waiting.\r\n\r\nAnd it''s you I see, but you don''t see me.\r\nAnd it''s you I hear, so loud and so clear\r\nI sing it loud and clear.\r\nAnd I''ll always be waiting for you.\r\n\r\nSo I look in your direction,\r\nBut you pay me no attention,\r\nAnd you know how much I need you,\r\nBut you never even see me.', '', 303, '', '', '', '', '', '', 0, 0, 1, '2012-12-25 22:41:56', '2014-09-20 01:56:02', '2014-09-20 01:56:02'),
